    clientId: "MrwXYF68n0T0qnOnDtYL0PxUsHHM4z9t",
    clientSecret:'eVOovXDj_36CB4Clz2In2PL9igCwfsBIz7JrPfv2Q9YV4jXIv9QhOh25M2gUPMY2',
    scope:'openid profile',
    domain:'dev-gfeh5frx.auth0.com', //no cadastro
    redirectUri: 'http://localhost:3000/api/callback',
    postLogoutRedirectUri: 'http://localhost:3000',
